 ('36', '36', 'en_us', 'Seminary Registration', NULL, '<p>It is time to register seminary students for the 2017/2018 school year. If you have children who will be in 9th through 12th grades next school year, please go to <a href=\"https://www.lds.org/si/seminary\" target=\"_blank\" rel=\"noreferrer\">https://www.lds.org/si/seminary</a>, click on the mySeminary App, and sign in with your LDS Account username and password to register your children.</p>', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-09 16:06:40', '2017-03-24 14:20:07', '7f42882f-5ddd-46d3-a787-47d7bf39d68a'),
