 ('48', '48', 'en_us', 'Mormon Prom, 2017', NULL, NULL, 'Join us for an Enchanted Evening. There will be a dinner and a dance.', '1', 'Puyallup and Puyallup South Stake Centers', '<p>Please register for prom before the deadline <strong>April 21st</strong>. If you have missed this deadline, please contact Sister Amber Doty, our Stake YW President for assistance.</p>\n<p>The registration website is <a href=\"http://www.GrahamWaStake.com\">www.GrahamWaStake.com</a>. Just click on the Prom Registration link. The password to register is: <strong><em>LDSYouth</em></strong> and is case sensitive.</p>\n<p>See invitation below for other details.</p>\n<p><img src=\"{asset:47:url}\" alt=\"finalpromcorrectqr.jpg#asset:47\" /><br /></p>', 'http://grahamwastake.com/multi-stake-prom/prom-registration/', NULL, NULL, NULL, NULL, 'Mormon Prom', '2017-03-24 14:08:46', '2017-04-10 14:03:13', '43845f40-cdb7-4bf0-baba-a49a40c815f2'),
 ('49', '49', 'en_us', 'Mormon Prom', NULL, '<p>Mormon Prom will be held on May 5, 2017. Please register for prom before the deadline <strong>April 21st</strong>. See the <a href=\"{entry:48:url}\">event page</a> for details, and register <a href=\"http://grahamwastake.com/multi-stake-prom/prom-registration/\">here</a>. The password to register is: <strong><em>LDSYouth</em></strong> and is case sensitive.<br /></p>', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-24 14:12:56', '2017-04-10 14:03:49', '93a7edb1-073e-4618-a97e-9c904bc21b6b');



DROP TABLE IF EXISTS `craft_deprecationerrors`;


